insert  into `content`(`id`,`section_id`,`image1`,`image2`,`title`,`intro`,`description`,`link`,`txtbtn_pelajari`) values (2,'16.104','','','FORM CREDIT APPLICATION','I hereby submit a loan (credit) for the purchase of the product:','','/',''),(3,'17.84',NULL,NULL,'JOIN CREDITPLUS','Kreditplus opens opportunities for young professionals / new graduates to experience learning as well as work that sharpen and build self-capabilities. Join us.','<p>Seek talented and potential individuals who are able to reflect corporate values ​​to be part of the team that accelerates the achievement of the vision. Develop your ideas, creativity and innovation as a solution in order to improve operational quality up to business development. Find challenging jobs and tasks and workplace options. You will work with colleagues from various educational backgrounds, professions and cultures. Find valuable experience and feel how all these things can develop your skills and competencies.</p>\r\n',NULL,NULL),(6,'24.89',NULL,NULL,'Branch Office','Temukan Cabang Kreditplus terdekat','','/',''),(7,'23.92',NULL,NULL,'gfdsdggf','fdssfdfsd','<p>fdfdssfdsfd</p>\r\n',NULL,NULL),(8,'28.97',NULL,NULL,'Company Profile','PT. Finansia Multi Finance dengan brand Kreditplus merupakan suatu badan usaha bersama antara perusahaan gabungan profesional Indonesia dan Singapura dan perusahaan Amerika. ','<p>Sejak didirikan pada tanggal 9 Juni 1994 Kreditplus telah memiliki jaringan kantor cabang yang tersebar luas hingga 260 titik di seluruh Indonesia dan telah memiliki pengalaman lebih dari 20 tahun dalam bidang pembiayaan konsumen..</p>\r\n\r\n<p>Berawal hanya dari membiayai&nbsp;<strong>motor, mobil dan alat-alat berat</strong>,&nbsp;Kreditplus membangun usaha dan menjaring konsumen, hingga tetap bertahan di saat krisis ekonomi melanda Indonesia melalui diverisifikasi usaha dan menambah jumlah produk yang dibiayai. Kemudian Kreditplus merubah produk dengan membiayai&nbsp;<strong>Motor Baru, Elektronik, KPR dan Motor Bekas</strong>.</p>\r\n\r\n<p><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/office-01.jpg\" /><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/office-02.jpg\" /></p>\r\n\r\n<p>Dengan selalu mengikuti perkembangan jaman dan kebutuhan konsumen, kreditplus meningkatkan fasilitas dengan mengembangkan sistem dan jaringan terpadu. Salah satu strateginya adalah dengan menjalin kerjasama dengan&nbsp;<em><strong>ecommerce channel</strong></em>&nbsp;melalui system yang terintegrasi dalam rangka memberikan layanan terbaik kepada konsumen dalam melakukan transaksi&nbsp;<em><strong>online</strong></em>&nbsp;tanpa kartu kredit.</p>\r\n\r\n<p>Sebagai perusahaan pembiayaan, kreditplus memberikan limit pembiayaan&nbsp; yang maksimal untuk beragam kategori produk seperti : gadget, audio video, home appliance, computer / laptop, furniture, game console hingga sport equipment dibiayai oleh kreditplus dengan jangka waktu pembiayaan yang variatif. Dengan mengusung prinsip&nbsp;<strong>&ldquo;belanja online tanpa kartu kredit&rdquo;</strong>, kreditplus juga menjangkau konsumen baru yang bertransaksi secara online melalui ecommerce channel yang ternama dan dipercaya.</p>\r\n\r\n<p>Inovasi lainnya dari Kreditplus untuk meningkatkan penjualan di dunia digital,&nbsp;<strong>Kreditplus mobile dan digital application form</strong>&nbsp;menjadi tawaran menarik lainnya bagi konsumen. Informasi yang akurat dalam system berbasis mobile memudahkan konsumen mendapatkan informasi akurat sejak pengajuan diajukan hingga persetujuan, jumlah cicilan beserta tanggal jatuh tempo dan layanan contact center.</p>\r\n\r\n<p>Kerjasama dengan lebih dari 9.000 jaringan ATM berbagai bank, Kantor Pos, gerai Indomaret dan Alfamart menambah berbagai kemudahan yang ditawarkan kreditplus kepada konsumen.</p>\r\n\r\n<p><strong>Perlu Kredit ..?.. Ingat Kreditplus</strong></p>\r\n','/',''),(9,'6.97',NULL,NULL,'Application GCG','The practice of Good Corporate Governance (GCG) becomes essential in the management of the Company','<p>EN This is Photoshop&#39;s version of Lorem Ipsum. Proin gravida nibh vel velit auctor aliquet. Aenean sollicitudin, lorem quis bibendum auctor, nisi elit consequat ipsum, nec sagittis sem nibh id elit. Duis sed odio sit amet nibh vulputate cursus a sit amet mauris. Morbi accumsan ipsum velit. Nam nec tellus a odio tincidunt auctor a ornare odio. Sed non mauris vitae erat consequat auctor eu in elit. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos.</p>\r\n\r\n<p><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/7cf3a051a2df4fc43ba765933d5dea4d_gcg-img.jpg\" /></p>\r\n\r\n<h4>This is Lorem Ipsum</h4>\r\n\r\n<p>This is Photoshop&#39;s version of Lorem Ipsum. Proin gravida nibh vel velit auctor aliquet. Aenean sollicitudin, lorem quis bibendum auctor, nisi elit consequat ipsum, nec sagittis sem nibh id elit. Duis sed odio sit amet nibh vulputate cursus a sit amet mauris. Morbi accumsan ipsum velit. Nam nec tellus a odio tincidunt auctor a ornare odio. Sed non mauris vitae erat consequat auctor eu in elit. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. This is Photoshop&#39;s version of Lorem Ipsum. Proin gravida nibh vel velit auctor aliquet. Aenean sollicitudin, lorem quis bibendum auctor, nisi elit consequat ipsum, nec sagittis sem nibh id elit. Duis sed odio sit amet nibh vulputate cursus a sit amet mauris. Morbi accumsan ipsum velit. Nam nec tellus a odio tincidunt auctor a ornare odio. Sed non mauris vitae erat consequat auctor eu in elit. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Mauris in erat justo. Nullam ac urna eu felis dapibus condimentum sit amet a augue. Sed non neque elit. Sed ut imperdiet nisi. Proin condimentum fermentum nunc. Etiam pharetra, erat sed fermentum feugiat, velit mauris egestas quam, ut aliquam massa nisl quis neque. Suspendisse in orci enim.</p>\r\n','/',''),(12,'31.97',NULL,NULL,'Feature KreditPlus Mobile','Nikmati kemudahan kredit online dalam genggaman Anda!','<p><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/image%20KPM%20mobile2.jpg\" /></p>\r\n\r\n<p>Kreditplus mobile merupakan fasilitas dari Kreditplus yang menawarkan kemudahan transaksi kredit secara online berbasis aplikasi mobile. Download kreditplus mobile, kredit semakin Mudah, Cepat dan Aman</p>\r\n\r\n<p>Fitur :</p>\r\n\r\n<ul>\r\n	<li>Kredit multiguna</li>\r\n	<li>Pinjaman Modal Kerja</li>\r\n	<li>Untuk pengembangan modal bisnis dengan menggunakan agunan kendaraan.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/image%20KPM%20mobile1.jpg\" /></p>\r\n','/',''),(13,'12.97',NULL,NULL,'Fitur KreditMu','','<p><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/image%20Kreditmu1.jpg\" /></p>\r\n\r\n<p><u><strong>4 LANGKAH AKTIFKAN KREDITMU</strong></u></p>\r\n\r\n<ol>\r\n	<li>Daftar di www.kreditmu.com atau melalui kreditplus mobile</li>\r\n	<li>Verifikasi data</li>\r\n	<li>Terima sms limit kredit</li>\r\n	<li>Belanja di website / toko rekanan kreditplus</li>\r\n</ol>\r\n\r\n<p><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/image%20Kreditmu2.jpg\" /></p>\r\n\r\n<p><strong>MUDAH</strong><br />\r\nMengedepankan kemudahan transaksi kredit dimulai saat konsumen melakukan pengajuan plafond kredit sampai proses transaksi kredit.</p>\r\n\r\n<p><strong>CEPAT</strong><br />\r\nKecepatan mendapatkan keputusan kredit berdasarkan plafond kredit konsumen</p>\r\n\r\n<p><strong>AMAN</strong><br />\r\nAman karena transaksi kredit dicover Asuransi Barang dan Jiwa.</p>\r\n\r\n<p>**Kreditmu dapat di transaksikan melalui Channel E&ndash;Commerce maupun toko rekanan yang sudah memiliki kerjasama dengan kreditplus</p>\r\n','/',''),(14,'4.97',NULL,NULL,'Management','','<p>Kreditplus memiliki lisensi pembiayaan modal kerja, pembiayaan multi guna dan berbagai aktivitas lainnya sesuai dengan persetujuan Otoritas Jasa Keuangan. Saat ini, Kreditplus memfokuskan bisnisnya pada pembiayaan mobil, motor dan elektronik. Serta telah menjadi salah satu pemain terkemuka di industri pembiayaan yang tersebar melalui jaringan distribusi di 244 lokasi di seluruh Indonesia serta didukung oleh lebih dari 12.000 karyawan.</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/bod.jpg\" /><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/ic_phone.png\" style=\"height:60px; width:60px\" /></p>\r\n','/',''),(15,'5.101',NULL,NULL,'Achievement','This is Photoshop\'s version of Lorem Ipsum.','<p>This is Photoshop&#39;s version of Lorem Ipsum. Proin gravida nibh vel velit auctor aliquet.</p>\r\n','/',''),(17,'36.97',NULL,NULL,'fdgfd','gfgfgfgdgf','<p>gffgfddfdf</p>\r\n','/','');

