insert  into `content_i18n`(`id`,`lang_code`,`content_id`,`intro`,`description`,`create_on`,`title`,`txtbtn_pelajari`) values (2,'id',3,'Kreditplus membuka peluang bagi professional muda/lulusan baru untuk pengalaman belajar sekaligus bekerja yang mengasah dan membangun kapabilitas diri. Bergabunglah bersama kami.','<p>Mencari individu-individu berbakat dan berpotensi yang mampu mencerminkan tata nilai perusahaan untuk menjadi bagian dari tim yang mengakselerasi pencapaian visi. Kembangkanlah ide, kreativitas dan inovasi anda sebagai solusi dalam rangka peningkatan kualitas operasional sampai dengan pengembangan bisnis. Temukan berbagai pekerjaan dan tugas yang menantang dan berbagai pilihan tempat bekerja. Anda akan bekerja sama dengan rekan kerja dari berbagai latar belakang pendidikan, profesi dan budaya. Temukan pengalaman berharga dan rasakan bagaimana semua hal tersebut dapat mengembangkan kemampuan dan kompetensi anda.</p>\r\n','2017-11-01 10:19:55','BERGABUNG DENGAN KREDITPLUS',NULL),(3,'id',2,'Saya dengan ini mengajukan pembiayaan (kredit) untuk pembelian produk :','','2017-11-01 10:26:11','FORM PENGAJUAN KREDIT',''),(6,'id',6,'Temukan Cabang Kreditplus terdekat','','2017-11-08 06:00:53','Kantor Cabang',''),(7,'id',7,'fdsfdsfdsd','<p>fsdfsdfsd</p>\r\n','2017-11-09 04:13:25','dsffsdsdf',NULL),(8,'id',8,'PT. Finansia Multi Finance dengan brand Kreditplus merupakan suatu badan usaha bersama antara perusahaan gabungan profesional Indonesia dan Singapura dan perusahaan Amerika. ','<p>Sejak didirikan pada tanggal 9 Juni 1994 Kreditplus telah memiliki jaringan kantor cabang yang tersebar luas hingga 260 titik di seluruh Indonesia dan telah memiliki pengalaman lebih dari 20 tahun dalam bidang pembiayaan konsumen..</p>\r\n\r\n<p>Berawal hanya dari membiayai&nbsp;<strong>motor, mobil dan alat-alat berat</strong>,&nbsp;Kreditplus membangun usaha dan menjaring konsumen, hingga tetap bertahan di saat krisis ekonomi melanda Indonesia melalui diverisifikasi usaha dan mena