CREATE TABLE `content_kreditplus` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `section_id` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `title` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `intro` varchar(2000) COLLATE utf8_unicode_ci NOT NULL,
  `description` text COLLATE utf8_unicode_ci NOT NULL,
  `image` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `content_kreditplus` */

insert  into `content_kreditplus`(`id`,`section_id`,`title`,`intro`,`description`,`image`) values (3,'12.51','FITUR KREDITMU','<p><span style=\"font-size:18px\"><strong>Your credit is the payment method &quot;CICILAN WITHOUT CREDIT CARD&quot; from Kreditplus (PT.Finansia Multifinance). With your credit, you can buy the goods in installments with the period from 3, 6, to 12 months.</strong></span></p>\r\n\r\n<p>By registering with your Credit, you will be provided with a quick cicialan limit facility that can be used to shop online (elevenia, jd.id, pasarwarga, livaza) &quot;NO CREDIT CARD WITHOUT RIBET&quot;.</p>\r\n','<p>Your credit is the payment method &quot;CICILAN WITHOUT CREDIT CARD&quot; from Kreditplus (PT.Finansia Multifinance). With your credit, you can buy the goods in installments with the period from 3, 6, to 12 months.<br />\r\nBy registering with your Credit, you will be provided with a quick cicialan limit facility that can be used to shop online (elevenia, jd.id, pasarwarga, livaza) &quot;NO CREDIT CARD WITHOUT RIBET&quot;.</p>\r\n','site/uploads/banners/59fac657668d9-promo-img3.jpg'),(4,'11.51','FITUR KREDITPLUS MOBILE','<h3>Kreditplus Mobile is a consumer finance services application from Kreditplus that offers various facilities and benefits for all users (non-members and members of Kreditplus) in one hand.</h3>\r\n\r\n<p><span style=\"font-family:Times New Roman,Times,serif\"><span style=\"font-size:16px\">In accordance with our motto is fast, easy, and secure, enjoy the speed of information and ease of credit application up to direct payment from your smartphone.</span></span></p>\r\n','<p>You can start developing your dream business with business capital and multipurpose services of motorcycles and cars from Kreditplus and fulfill all your electronic needs with multipurpose services.</p>\r\n\r\n<p>While available for Jabodetabek area.<br />\r\nFor further information please contact Contact Center KreditPlus 1500 605.</p>\r\n','site/uploads/banners/59fac6239793b-promo-img2.jpg'),(5,'27.83','Title','<p>Intro</p>\r\n','<p>Description</p>\r\n','site/uploads/banners/5a0007ace7e54-promo-img2-bw.jpg');

