/*Data for the table `content_kreditplus_i18n` */

insert  into `content_kreditplus_i18n`(`id`,`lang_code`,`content_kreditplus_id`,`title`,`intro`,`description`,`create_on`) values (1,'id',2,'FITUR KREDITPLUS MOBILE','<h3>Kreditplus Mobile adalah aplikasi jasa pembiayaan konsumen dari Kreditplus yang menawarkan berbagai kemudahan dan manfaat bagi seluruh pengguna (member maupun non-member Kreditplus) dalam satu genggaman.</h3>\r\n\r\n<p>Sesuai dengan motto kami yaitu cepat, mudah, dan aman, nikmati kecepatan informasi dan kemudahan pengajuan kredit sampai dengan pembayaran langsung dari smartphone anda.</p>\r\n','<p>Anda dapat mulai mengembangkan usaha impian anda dengan layanan modal usaha maupun multiguna motor dan mobil dari Kreditplus serta penuhi semua kebutuhan elektronik anda dengan layanan multiguna barang.</p>\r\n\r\n<p>Sementara tersedia untuk wilayah Jabodetabek.<br />\r\nInformasi lebih lanjut hubungi&nbsp;<a href=\"http://localhost/kreditplus__/information_promo_detail2.php\"><strong>Contact Center KreditPlus 1500 605.</strong></a></p>\r\n','2017-11-01 09:49:46'),(2,'id',4,'FITUR KREDITPLUS MOBILE','<h3>Kreditplus Mobile adalah aplikasi jasa pembiayaan konsumen dari Kreditplus yang menawarkan berbagai kemudahan dan manfaat bagi seluruh pengguna (member maupun non-member Kreditplus) dalam satu genggaman.</h3>\r\n\r\n<p>Sesuai dengan motto kami yaitu cepat, mudah, dan aman, nikmati kecepatan informasi dan kemudahan pengajuan kredit sampai dengan pembayaran langsung dari smartphone anda.</p>\r\n','<p>Anda dapat mulai mengembangkan usaha impian anda dengan layanan modal usaha maupun multiguna motor dan mobil dari Kreditplus serta penuhi semua kebutuhan elektronik anda dengan layanan multiguna barang.</p>\r\n\r\n<p>Sementara tersedia untuk wilayah Jabodetabek.<br />\r\nInformasi lebih lanjut hubungi&nbsp;<a href=\"http://localhost/kreditplus__/information_promo_detail2.php\"><strong>Contact Center KreditPlus 1500 605.</strong></a></p>\r\n','2017-11-01 09:56:53'),(3,'id',3,'FITUR KREDITMU','<h3>Kreditmu adalah metode pembayaran &quot;CICILAN TANPA KARTU KREDIT&quot; dari Kreditplus (PT.Finansia Multifinance). Dengan kreditmu, Anda bisa membeli barang dengan cara dicicil dengan periode dari 3, 6, sampai 12 bulan.</h3>\r\n\r\n<p>Dengan mendafat di Kreditmu, Anda akan diberikan fasilitas limit cicialan dengan cepat yang bisa digunakan untuk berbelanja secara online (elevenia, jd.id, pasarwarga, livaza) &quot;TANPA KARTU KREDIT TANPA RIBET&quot;.</p>\r\n','<p>Kreditmu adalah metode pembayaran &quot;CICILAN TANPA KARTU KREDIT&quot; dari Kreditplus (PT.Finansia Multifinance). Dengan kreditmu, Anda bisa membeli barang dengan cara dicicil dengan periode dari 3, 6, sampai 12 bulan.<br />\r\nDengan mendafat di Kreditmu, Anda akan diberikan fasilitas limit cicialan dengan cepat yang bisa digunakan untuk berbelanja secara online (elevenia, jd.id, pasarwarga, livaza) &quot;TANPA KARTU KREDIT TANPA RIBET&quot;.</p>\r\n','2017-11-01 09:58:43'),(4,'id',5,'Title (ID)','<p>Intro (ID)</p>\r\n','<p>Description (ID)</p>\r\n','2017-11-06 06:30:15');

