insert  into `content_produk`(`id`,`section_id`,`title`,`intro`,`description`) values (2,'8.41','Multi Guna Elektronik','Didukung oleh lebih dari 5.000 dealer yang tersebar di seluruh Indonesia. ','<p>Kredit Plus terus mengembangkan pembiayaan di bidang Elektronik, Furniture, Gadget, Computer, Alat Musik, Alat Olah raga dll. Kreditplus juga menjalin kerjasama yang baik dengan berbagai Prinsipal besar seperti Samsung, Sharp, Elektrolux, LG, Panasonic, dll</p>\r\n\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th class=\"a-left\">Persyaratan Umum</th>\r\n			<th>Karyawan</th>\r\n			<th>Wiraswasta</th>\r\n			<th>Profesional</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td data-title=\"Persyaratan Umum\">Fotocopy KTP Pemohon</td>\r\n			<td class=\"a-center\" data-title=\"Karyawan\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/ic_checked.png\" style=\"width: 28px; height: 21px;\" /></td>\r\n			<td class=\"a-center\" data-title=\"Wiraswasta\">&nbsp;</td>\r\n			<td class=\"a-center\" data-title=\"Profesional\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td data-title=\"Persyaratan Umum\">Fotocopy Surat Ijin Usaha Perdagangan (SIUP)</td>\r\n			<td class=\"a-center\" data-title=\"Karyawan\">&nbsp;</td>\r\n			<td class=\"a-center\" data-title=\"Wiraswasta\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/ic_checked.png\" style=\"width: 28px; height: 21px;\" /></td>\r\n			<td class=\"a-center\" data-title=\"Profesional\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td data-title=\"Persyaratan Umum\">Fotocopy Nomor Pokok Wajib Pajak (NPWP)</td>\r\n			<td class=\"a-center\" data-title=\"Karyawan\">&nbsp;</td>\r\n			<td class=\"a-center\" data-title=\"Wiraswasta\">&nbsp;</td>\r\n			<td class=\"a-center\" data-title=\"Profesional\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/ic_checked.png\" style=\"width: 28px; height: 21px;\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td data-title=\"Persyaratan Umum\">Fotocopy Rekening Koran/Rekening Tabungan 3 Bulan Terakhir</td>\r\n			<td class=\"a-center\" data-title=\"Karyawan\">&nbsp;</td>\r\n			<td class=\"a-center\" data-title=\"Wiraswasta\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/ic_checked.png\" style=\"width: 28px; height: 21px;\" /></td>\r\n			<td class=\"a-center\" data-title=\"Profesional\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td data-title=\"Persyaratan Umum\">Fotocopy Slip Gaji atau surat Keterangan Penghasilan Resmi dan Sah ( Bulan Terakhir )</td>\r\n			<td class=\"a-center\" data-title=\"Karyawan\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/ic_checked.png\" style=\"width: 28px; height: 21px;\" /></td>\r\n			<td class=\"a-center\" data-title=\"Wiraswasta\">&nbsp;</td>\r\n			<td class=\"a-center\" data-title=\"Profesional\">&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n'),(3,'9.41','EN PEMBELIAN MOTOR','Plus Credit provides your motorcycle financing solutions with an easy, fast and secure process.','<p>EN Solusi pembiayaan kendaraan mobil &amp; motor anda dengan proses yang mudah, cepat dan aman. Berbagai kemudahan yang ditawarkan Kreditplus yaitu :</p>\r\n\r\n<ol>\r\n	<li>3 jam sudah bisa transaksi</li>\r\n	<li>Membiayai kendaraan Jepang ataupun non jepang</li>\r\n	<li>Asuransi atas mobil &amp; motor yang dibiayai sepanjang masa pembiayaan</li>\r\n	<li>Asuransi jiwa atas konsumen yang mengajukan pembiayaan</li>\r\n	<li>Dapat membiayai kendaraan hingga 10 tahun termasuk tenor</li>\r\n	<li>Jangka waktu pembiayaan mulai dari 9 hingga 47 bulan</li>\r\n	<li>Pembayaran angsuran yang mudah melalui berbagai payment point</li>\r\n</ol>\r\n\r\n<p><br />\r\nBerikut adalah persyaratan aplikasi pengajuan kredit mobil:&nbsp;</p>\r\n\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>Persyaratan Umum</th>\r\n			<th>Karyawan</th>\r\n			<th>Wiraswasta</th>\r\n			<th>Profesional</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Fotocopy KTP Pemohon</td>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/bf337d1682914a8a6895f4764010e94d_ic_checked.png\" /></td>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/bf337d1682914a8a6895f4764010e94d_ic_checked.png\" /></td>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/bf337d1682914a8a6895f4764010e94d_ic_checked.png\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fotocopy Surat Ijin Usaha Perdagangan (SIUP)</td>\r\n			<td>&nbsp;</td>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/bf337d1682914a8a6895f4764010e94d_ic_checked.png\" /></td>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/bf337d1682914a8a6895f4764010e94d_ic_checked.png\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fotocopy Nomor Pokok Wajib Pajak (NPWP)</td>\r\n			<td>&nbsp;</td>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/bf337d1682914a8a6895f4764010e94d_ic_checked.png\" /></td>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/bf337d1682914a8a6895f4764010e94d_ic_checked.png\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fotocopy Rekening Koran/Rekening Tabungan 3 Bulan Terakhir</td>\r\n			<td>&nbsp;</td>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/bf337d1682914a8a6895f4764010e94d_ic_checked.png\" /></td>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/bf337d1682914a8a6895f4764010e94d_ic_checked.png\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fotocopy Slip Gaji atau surat Keterangan Penghasilan Resmi dan Sah ( Bulan Terakhir )</td>\r\n			<td><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/bf337d1682914a8a6895f4764010e94d_ic_checked.png\" /></td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Informasi lebih lanjut mengenai pembiayaan Kreditplus dapat diperoleh melalui petugas kami di toko/dealer rekanan kami atau langsung menghubungi kantor cabang krediplus terdekat.</p>\r\n'),(4,'10.41','Multi Guna Mobil','Adalah solusi pembiayaan mobil anda dengan proses yang mudah, cepat dan aman, dengan jaminan BPKB kendaraan dari Debitur dan tenor diperjanjikan.','<p>Berbagai kemudahan yang ditawarkan kreditplus yaitu :</p>\r\n\r\n<ul>\r\n	<li>3 jam sudah bisa transaksi</li>\r\n	<li>Membiayai kendaraan Jepang ataupun non jepang</li>\r\n	<li>Asuransi atas mobil yang dibiayai sepanjang masa pembiayaan</li>\r\n	<li>Asuransi jiwa atas konsumen yang mengajukan pembiayaan</li>\r\n	<li>Dapat membiayai kendaraan dengan umur kendaraan hingga 15 (lima belas) tahun termasuk tenor</li>\r\n	<li>Jangka waktu pembiayaan mulai dari 12 hingga 36 bulan</li>\r\n	<li>Pembayaran angsuran yang mudah melalui berbagai payment gateway</li>\r\n</ul>\r\n'),(5,'27.37','PINJAMAN USAHA','Intro','<p>Description</p>\r\n\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>Persyaratan Umum</th>\r\n			<th>Karyawan</th>\r\n			<th>Wiraswasta</th>\r\n			<th>Profesional</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Copy of Applicant&#39;s ID</td>\r\n			<td>v</td>\r\n			<td>v</td>\r\n			<td>v</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Copy of Trading Business License (SIUP)</td>\r\n			<td>&nbsp;</td>\r\n			<td>v</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Copy of Taxpayer Identification Number (NPWP)</td>\r\n			<td>v</td>\r\n			<td>v</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Copy of Newspaper Account / Last 3 Month Savings Account</td>\r\n			<td>&nbsp;</td>\r\n			<td>v</td>\r\n			<td>v</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Copy of Salary Slip or Certificate of Official and Legal Income (Last Month)</td>\r\n			<td>&nbsp;</td>\r\n			<td>v</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n'),(6,'30.41','Kreditmu ','Apa itu kreditmu? Bisa apa saja?','<p>Kreditmu adalah metode pembayaran &quot;<strong>CICILAN TANPA KARTU KREDIT</strong>&quot; dari Kreditplus (PT. Finansia Multifinance). Dengan kreditmu, Anda bisa membeli barang dengan cara dicicil dengan periode dari 3, 6 sampai 12 bulan.&nbsp;</p>\r\n\r\n<p>Dengan mendaftar di Kreditmu, Anda akan diberikan fasilitas limit cicilan dengan cepat yang bisa digunakan untuk berbelanja secara online (elevania, jd.id, pasarwarga dan livaza) &quot;<strong>TANPA KARTU KREDIT TANPA RIBET</strong>&quot;.&nbsp;</p>\r\n\r\n<p>Bertransaksi menggunakan Kreditmu &quot;<strong>TANPA BIAYA ADMIN, TANPA DP, PEMBAYARAN PERTAMA DI BULAN DEPAN</strong>&quot;.</p>\r\n'),(7,'36.41','Multi Guna Motor','“Transaksi Pembiayaan untuk pengadaan barang Motor Bekas  dengan jaminan BPKB kendaraan dari Debitur dan tenor diperjanjikan“','<p>Kendaraan yang dibiayai ATPM, yaitu :</p>\r\n\r\n<ol>\r\n	<li>Honda</li>\r\n	<li>Suzuki</li>\r\n	<li>Yamaha</li>\r\n	<li>Kawasaki</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Jenis Kendaraan , yaitu :</p>\r\n\r\n<ul>\r\n	<li>Matic</li>\r\n	<li>Bebek</li>\r\n	<li>Sport<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p>Note :<br />\r\nUmur kendaraan&nbsp; max. 10 tahun termasuk tenor</p>\r\n'),(8,'37.41','Modal Usaha','Adalah solusi kebutuhan pengadaan barang modal dan bahan baku dengan proses yang mudah, cepat dan aman.','<p>Berbagai kemudahan yang ditawarkan Kreditplus yaitu :</p>\r\n\r\n<ul>\r\n	<li>3 jam sudah bisa transaksi</li>\r\n	<li>Cukup dengan melampirkan invoice/bon/kwitansi dari penyedia barang modal dan atau bahan baku</li>\r\n	<li>Jangka waktu pembiayaan mulai dari 9 hingga 47 bulan</li>\r\n	<li>Jaminan BPKB &ldquo;Mobil &amp; Motor&rdquo;</li>\r\n	<li>Pembayaran angsuran yang mudah melalui berbagai payment point</li>\r\n</ul>\r\n\r\n<p>Dokumen persyaratan :</p>\r\n\r\n<p>Informasi lebih lanjut mengenai pembiayaan Kreditplus dapat diperoleh melalui petugas kami d