insert  into `content_produk_i18n`(`id`,`lang_code`,`content_produk_id`,`title`,`intro`,`description`,`create_on`) values (2,'id',2,'Multi Guna Elektronik','Didukung oleh lebih dari 5.000 dealer yang tersebar di seluruh Indonesia. ','<p>Kredit Plus terus mengembangkan pembiayaan di bidang Elektronik, Furniture, Gadget, Computer, Alat Musik, Alat Olah raga dll. Kreditplus juga menjalin kerjasama yang baik dengan berbagai Prinsipal besar seperti Samsung, Sharp, Elektrolux, LG, Panasonic, dll</p>\r\n','2017-11-01 08:00:56'),(3,'id',3,'PEMBELIAN MOTOR','Kredit Plus memberikan solusi pembiayaan motor anda dengan proses yang mudah, cepat dan aman.','<p>Solusi pembiayaan kendaraan mobil &amp; motor anda dengan proses yang mudah, cepat dan aman. Berbagai kemudahan yang ditawarkan Kreditplus yaitu :</p>\r\n\r\n<ol>\r\n	<li>3 jam sudah bisa transaksi</li>\r\n	<li>Membiayai kendaraan Jepang ataupun non jepang</li>\r\n	<li>Asuransi atas mobil &amp; motor yang dibiayai sepanjang masa pembiayaan</li>\r\n	<li>Asuransi jiwa atas konsumen yang mengajukan pembiayaan</li>\r\n	<li>Dapat membiayai kendaraan hingga 10 tahun termasuk tenor</li>\r\n	<li>Jangka waktu pembiayaan mulai dari 9 hingga 47 bulan</li>\r\n	<li>Pembayaran angsuran yang mudah melalui berbagai payment point</li>\r\n</ol>\r\n\r\n<p><br />\r\nBerikut adalah persyaratan aplikasi pengajuan kredit mobil:&nbsp;</p>\r\n\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>Persyaratan Umum</th>\r\n			<th>Karyawan</th>\r\n			<th>Wiraswasta</th>\r\n			<th>Profesional</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Fotocopy KTP Pemohon</td>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/bf337d1682914a8a6895f4764010e94d_ic_checked.png\" /></td>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/bf337d1682914a8a6895f4764010e94d_ic_checked.png\" /></td>\r\n			<td style=\"text-align:center\"><img alt=\"\" src=\"http://dev.w