gan proses yang mudah, cepat dan aman, dengan jaminan BPKB kendaraan dari Debitur dan tenor diperjanjikan.','<p>Berbagai kemudahan yang ditawarkan kreditplus yaitu :</p>\r\n\r\n<ul>\r\n	<li>3 jam sudah bisa transaksi</li>\r\n	<li>Membiayai kendaraan Jepang ataupun non jepang</li>\r\n	<li>Asuransi atas mobil yang dibiayai sepanjang masa pembiayaan</li>\r\n	<li>Asuransi jiwa atas konsumen yang mengajukan pembiayaan</li>\r\n	<li>Dapat membiayai kendaraan dengan umur kendaraan hingga 15 (lima belas) tahun termasuk tenor</li>\r\n	<li>Jangka waktu pembiayaan mulai dari 12 hingga 36 bulan</li>\r\n	<li>Pembayaran angsuran yang mudah melalui berbagai payment gateway</li>\r\n</ul>\r\n','2017-11-01 08:02:01'),(5,'id',5,'Title (ID)','Intro (ID)','<p>Description (ID)</p>\r\n\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>Persyaratan Umum</th>\r\n			<th>Karyawan</th>\r\n			<th>Wiraswasta</th>\r\n			<th>Profesional</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Copy of Applicant&#39;s ID</td>\r\n			<td>v</td>\r\n			<td>v</td>\r\n			<td>v</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Copy of Trading Business License (SIUP)</td>\r\n			<td>&nbsp;</td>\r\n			<td>v</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Copy of Taxpayer Identification Number (NPWP)</td>\r\n			<td>v</td>\r\n			<td>v</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Copy of Newspaper Account / Last 3 Month Savings Account</td>\r\n			<td>&nbsp;</td>\r\n			<td>v</td>\r\n			<td>v</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Copy of Salary Slip or Certificate of Official and Legal Income (Last Month)</td>\r\n			<td>&nbsp;</td>\r\n			<td>v</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n','2017-11-06 04:00:19'),(6,'id',6,'Kreditmu','Apa itu kreditmu? Bisa apa saja?','<p>Kreditmu adalah metode pembayaran &quot;<strong>CICILAN TANPA KARTU KREDIT</strong>&quot; dari Kreditplus (PT. Finansia Multifinance). Dengan kreditmu, Anda bisa membeli barang dengan cara dicicil dengan