ev.webarq.info:8081/kreditplus-be/ck/files/ic_checked.png\" /></td>\r\n			<td class=\"a-center\" data-title=\"Wiraswasta\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/ic_checked.png\" /></td>\r\n			<td class=\"a-center\" data-title=\"Profesional\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/ic_checked.png\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td data-title=\"Persyaratan Umum\">Fotocopy Surat Ijin Usaha Perdagangan (SIUP)</td>\r\n			<td class=\"a-center\" data-title=\"Karyawan\">&nbsp;</td>\r\n			<td class=\"a-center\" data-title=\"Wiraswasta\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/ic_checked.png\" /></td>\r\n			<td class=\"a-center\" data-title=\"Profesional\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/ic_checked.png\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td data-title=\"Persyaratan Umum\">Fotocopy Nomor Pokok Wajib Pajak (NPWP)</td>\r\n			<td class=\"a-center\" data-title=\"Karyawan\">&nbsp;</td>\r\n			<td class=\"a-center\" data-title=\"Wiraswasta\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/ic_checked.png\" /></td>\r\n			<td class=\"a-center\" data-title=\"Profesional\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/ic_checked.png\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td data-title=\"Persyaratan Umum\">Fotocopy Rekening Koran/Rekening Tabungan 3 Bulan Terakhir</td>\r\n			<td class=\"a-center\" data-title=\"Karyawan\">&nbsp;</td>\r\n			<td class=\"a-center\" data-title=\"Wiraswasta\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/ic_checked.png\" /></td>\r\n			<td class=\"a-center\" data-title=\"Profesional\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/ic_checked.png\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td data-title=\"Persyaratan Umum\">Fotocopy Slip Gaji atau surat Keterangan Penghasilan Resmi dan Sah ( Bulan Terakhir )</td>\r\n			<td class=\"a-center\" data-title=\"Karyawan\"><img alt=\"\" src=\"http://dev.webarq.info:8081/kreditplus-be/ck/files/ic_checked.png\" /></td>\r\n			<td class=\"a-center\" data-title=\"Wiraswasta\">&nbsp;</td>\r\n			<td class=\"a-center\" data-title=\"Profesional\">&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Informasi lebih lanjut mengenai pembiayaan Kreditplus dapat diperoleh melalui petugas kami di toko/dealer rekanan kami atau langsung menghubungi kantor cabang krediplus terdekat.</p>\r\n','2017-12-22 08:49:23');

