insert  into `karir`(`id`,`section_id`,`title_job`,`penempatan`,`description`) values (12,'17.61','Management Trainee','Indonesia','<p>Kualifikasi :</p>\r\n\r\n<ul>\r\n	<li>Pria/Wanita</li>\r\n	<li>Usia maksimal 25 tahun</li>\r\n	<li>Belum menikah dan bersedia tidak menikah selama masa ikatan dinas</li>\r\n	<li>Pendidikan minimal S1 semua jurusan dari Universitas terkemuka</li>\r\n	<li>Fresh graduate atau memiliki pengalaman kerja maksimal 1 tahun Memiliki pengalaman dalam berorganisasi</li>\r\n	<li>Berjiwa kepemimpinan dan mempunyai kemauan untuk belajar</li>\r\n	<li>Bersedia ditempatkan di seluruh cabang kami.</li>\r\n</ul>\r\n\r\n<p><br />\r\nBergabung dan menjadi bagian dari PT. Finansia Multi Finance, dengan mengirimkan CV Anda ke :&nbsp;<a href=\"http://mailto:recruitment@finansia.com\">recruitment@finansia.com</a></p>\r\n'),(13,'17.61','Branch Manager','Indonesia','<p>Kualifikasi :</p>\r\n\r\n<ul>\r\n	<li>Usia maksimal 38 tahun</li>\r\n	<li>Pendidikan minimal S1</li>\r\n	<li>Pengalaman sebagai Branch Manager minimal 2 tahun di perusahaan pembiayaan motor / retail banking</li>\r\n	<li>Memiliki pengalaman menangani marketing, collection &amp; kredit</li>\r\n	<li>Memiliki jiwa enterpreneur, Tegas dan Berani mengambil sikap/keputusan.</li>\r\n	<li>Bekerja tanpa menghitung waktu.</li>\r\n	<li>Bersedia ditempatkan dimana saja</li>\r\n</ul>\r\n\r\n<p><br />\r\nBergabung dan menjadi bagian dari PT. Finansia Multi Finance, dengan mengirimkan CV Anda ke :&nbsp;<a href=\"http://mailto:recruitment@finansia.com\">recruitment@finansia.com</a></p>\r\n'),(14,'17.61','Payroll Supervisor','Indonesia','<p>Kualifikasi :</p>\r\n\r\n<ul>\r\n	<li>Usia maksimal 32 Tahun</li>\r\n	<li>Memiliki pengalaman minimal 1 tahun sebagai Supervisor dibidang Payroll/ Compensation and Benefit</li>\r\n	<li>Mengerti perhitungan pajak PPH21</li>\r\n	<li>Memahami E-SPT, Edabu (BPJS Kesehatan), SIPP online (Ketenagakerjaan)</li>\r\n	<li>Mahir menggunakan MS Office (Excel, Word)</li>\r\n	<li>Mampu meng