ma dengan Tim dan memiliki kemampuan supervisi.</li>\r\n</ul>\r\n\r\n<p><br />\r\nBergabung dan menjadi bagian dari PT. Finansia Multi Finance, dengan mengirimkan CV Anda ke :&nbsp;<a href=\"http://mailto:recruitment@finansia.com\">recruitment@finansia.com</a></p>\r\n','2017-12-12 03:56:38'),(7,'id',15,'<p>Kualifikasi :</p>\r\n\r\n<ul>\r\n	<li>Pendidikan minimal S1 Psikologi</li>\r\n	<li>Usia maksimal 27 tahun</li>\r\n	<li>Memiliki pengalaman minimal 2 tahun sebagai Recruitment</li>\r\n	<li>Memahami alat test psikologi</li>\r\n	<li>Memiliki pengalaman dalam melakukan kerjasama dengan pihak ketiga: Headhunter / Perusahaan Outsourcing/Kampus/Sekolah</li>\r\n	<li>Memiliki kemampuaan dalam menganalisa data</li>\r\n	<li>Memiliki inisiatif yang tinggi</li>\r\n	<li>Memiliki kemampuan komunikasi yang baik</li>\r\n</ul>\r\n\r\n<p><br />\r\nBergabung dan menjadi bagian dari PT. Finansia Multi Finance, dengan mengirimkan CV Anda ke :&nbsp;<a href=\"http://mailto:recruitment@finansia.com\">recruitment@finansia.com</a></p>\r\n','2017-12-12 03:58:33'),(8,'id',16,'<p>Kualifikasi :</p>\r\n\r\n<ul>\r\n	<li>Pendidikan Min. D3 Max. S1(lebih diprioritaskan) Akuntansi</li>\r\n	<li>Wajib memiliki sertifikat Brevet B</li>\r\n	<li>Usia maks. 25 Tahun</li>\r\n	<li>Mengerti tentang perhitungan pajak (PPh23, PPh pasal 4 ayat 2, dan PPn)</li>\r\n	<li>Wajib paham penggunaan sistem e-SPT</li>\r\n	<li>Wajib memiliki pengalaman minimal 1 tahun dibagian accounting terutama tax</li>\r\n	<li>Komunikatif dan detil</li>\r\n</ul>\r\n\r\n<p><br />\r\nBergabung dan menjadi bagian dari PT. Finansia Multi Finance, dengan mengirimkan CV Anda ke :&nbsp;<a href=\"http://mailto:recruitment@finansia.com\">recruitment@finansia.com</a></p>\r\n','2017-12-12 03:59:00'),(9,'id',17,'<p>Kualifikasi :</p>\r\n\r\n<ul>\r\n	<li>Usia maksimal 30 tahun.</li>\r\n	<li>Pendidikan minimal S1</li>\r\n	<li>Memiliki pengalaman minimal 1 tahun retail banking atau perusahaan pembiayaan</li>\r\n	<li>Memiliki komunikasi yang baik &amp;